import React from "react";
import ItemStyles from "./styles/ItemStyles";

function Product({ item }) {
	const { name, price, description, photo } = item;
	return (
		<ItemStyles>
			<p>{name}</p>
			<p>${price}</p>
		</ItemStyles>
	);
}

export default Product;
